import { BrowserRouter, Route, Routes } from "react-router-dom";
import React from "react";
import './App.css';
import Navbar from './components/navbar';
import home from "./screens/home";

function App() {
  return (
    <div className="App">
      <Navbar/>


        <routes>
        <Route path="/home" element={<home/>}/>

        </routes>


    </div>
  );
}

export default App;
